import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const rootElement = document.getElementById('root');

class App extends React.Component {
	constructor(props) {
		super(props);
	}
	render() {
		return (
			<div id="loginCard">
				<form id="loginForm">
					<label class="loginGroup" htmlfor="username">Username:</label>
					<input class="loginGroup" type="text" id="username"/>
					<label class="loginGroup" htmlfor="username">Password:</label>
					<input class="loginGroup" type="password" id="password"/>
					<input type="submit" value="log in"/>
				</form>				
			</div>
		);
	}
}

ReactDOM.render(<App />, rootElement);
